import React, {
  Component
} from "react";
import Assets from "./components/assets";

class App extends Component {
  state = {
    counters: [{
        id: 1,
        value: 0
      },
      {
        id: 2,
        value: 0
      },
      {
        id: 3,
        value: 0
      },
      {
        id: 4,
        value: 0
      }
    ]
  };

  render() {
    return <Assets > < /Assets>;
  }
}
export default App;
